import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";

class Home extends React.Component {
  constructor(props) {
    super(props);
    const [mercaderia, setMercaderia] = useState([]);
    let traerProductos = async () => {
      const res = await axios.get(
        "https://fakerapi.it/api/v1/products?_quantity=20&_taxes=12&_categories_type=uuid"
      );
      setMercaderia(res.data.data);
      console.log(res.data.data);
    };
    useEffect(() => {
      traerProductos();
    }, []);
  }

  render() {
    return (
      <React.Fragment>
        <h2>Detectar Objeto</h2>

        <form action="/detectar-objeto/" method="post">
          <label>Imagen:</label>
          <input name="img1" type="file"></input>
          <br></br>
          <input type="submit" value="Aceptar"></input>
        </form>
      </React.Fragment>
    );
  }
}
export default Home;
